def get_gene_id(v):
    return v.split('gene_id "')[1].split('";')[0]

def get_gene_name(v):
    return v.split('gene_name "')[1].split('";')[0]

def get_gene_stable_id(v):
    return v.split('gene_id "')[1].split('";')[0].split('.')[0]

def get_gene_type(v):
    return v.split('gene_type "')[1].split('";')[0]

